    bytes32 role;
    bytes4[] funcSelectors;
    bool isEnabled;
  }

  struct RequestUpdateContext {
    bytes32 role;
    bytes4[] funcSelectors;
    UpdateContextStatus updateStatus;
  }

  struct ResponseContext {
    bytes32 name;
    bytes32 version;
    bytes32 realm;
    address contractId;
    bool isSafeMode;
    bool isUpgradable;
  }

